	var html = '';
	html += '<table class="atable">';
	html += '<tr><th colspan="3"><h2 class="h2">USER INFO</h2></th></tr>';
	html += '<tr><th>Username</th><td><input type="text" id="BOTSUSER" onChange="set(\'BOTSUSER\',this.value)" value="'+get('BOTSUSER')+'"></td><td>Please enter your given username, NOT YOUR BOTS user</td></tr>';
	html += '<tr><th>Password</th><td><input type="password" id="BOTSPASS" onChange="set(\'BOTSPASS\',this.value)" value="'+get('BOTSPASS')+'"></td><td>Please enter your given password, NOT YOUR BOTS pass</td></tr>';
	html += '</table>';
	html += '<table class="atable">';
	html += '<tr><th colspan="3"><div style="color: #ffff00; position: absolute;" onClick="clearAll()">Reset All</div><h2 class="h2">Fighting</h2></th></tr>';
	html += '<tr class="no"><th>Option</th><th>Status</th><th>Info</th></tr>';
	html += '<tr><th>Random Time to wait?:</th><td>'+YesNo("aFightWait")+'</td><td>Will wait 0-4 seconds after fight</td></tr>';
