	html += '</table>';
	html += '<table class="atable">';
	html += '<tr><th colspan="3"><h2 class="h2">Training</h2></th></tr>';
	html += '<tr class="no"><th>Option</th><th>Status</th><th>Info</th></tr>';
	html += '<tr><th>Random Time to wait?:</th><td>'+YesNo("aTrainWait")+'</td><td>Will wait 0-4 seconds after fight</td></tr>';
	html += '<tr><th>Captcha Solve:</th><td>'+YesNo("aTrainCaptcha")+'</td><td>Will auto solve captcha</td></tr>';
