	html += '</table>';
	html += '<table class="atable">';
	html += '<tr><th colspan="3"><h2 class="h2">Target Finder</h2></th></tr>';
	html += '<tr class="no"><th>Option</th><th>Status</th><th>Info</th></tr>';
	html += '<tr><th>Run?:</th><td>'+YesNo("aTargetOn")+'</td><td>Turns on Target Finder</td></tr>';
	html += '<tr><th>Max Energy:</th><td>'+Input("aTargetMaxE")+'</td><td>Sets Max Energy Req.</td></tr>';
	html += '<tr><th>Min Energy:</th><td>'+Input("aTargetMinE")+'</td><td>Sets Min Energy Req.</td></tr>';
	html += '<tr><th>Max Energy Ratio:</th><td>'+Input("aTargetMaxRE",1)+'</td><td>Sets Max Energy Ratio Req.</td></tr>';
	html += '<tr><th>Min Energy Ratio:</th><td>'+Input("aTargetMinRE",1)+'</td><td>Sets Min Energy Ratio Req.</td></tr>';
	html += '<tr><th>Max Ratio:</th><td>'+Input("aTargetMaxR",1)+'</td><td>Sets Max Win/Loss Ratio Req.</td></tr>';
	html += '<tr><th>Min Ratio:</th><td>'+Input("aTargetMinR",1)+'</td><td>Sets Min Win/Loss Ratio Req.</td></tr>';
	html += '<tr><td colspan="3">-1 = It will not make this check</td></tr></table>';
	html += '<table class="atable">';
	html += '<tr><th colspan="3"><h2 class="h2">Showroom Camper</h2></th></tr>';
	html += '<tr class="no"><th>Option</th><th>Status</th><th>Info</th></tr>';
	html += '<tr><th>Run?</th><td>'+YesNo("shopperDo")+'</td><td>Turns on Showroom Camper</td></tr>';
	html += '<tr><th>Auto Refresh</th><td>'+YesNo("shopperRefresh")+'</td><td>Auto-refreshes showroom</td></tr>';
	html += '<tr><th>Check Stash:</th><td>'+YesNo("shopperStash")+'</td><td>Prevents buying of item if in Stash already</td></tr>';
	html += '<tr><th>Check Equip:</th><td>'+YesNo("shopperEquip")+'</td><td>Prevents buying of item if Equipped already</td></tr>';
	html += '</table>';
