unsafe.shopthis = function(Spot,name) {
	alert(Spot+'-'+name);
	localStorage.setItem('spot'+Spot,name);
}

var WANTINGSPOTS = 6;

unsafe.clearAll = function() {
	for(x=1;x<=WANTINGSPOTS;x++) {
		localStorage.setItem('spot'+x,'');
	}
}
var html = '';

var all_items = bodyArray.concat(helmetArray).concat(glovesArray).concat(bootsArray).concat(weaponArray).concat(shieldArray);
function Comparator(a,b){
	if (a[1].toLowerCase() < b[1].toLowerCase()) return -1;
	if (a[1].toLowerCase() > b[1].toLowerCase()) return 1;
	return 0;
}
all_items.sort(Comparator);
html += '<table><tr><th colspan="2"><b>Showroom Camper</b> :: <span style="color: red;" onClick="clearAll()">Clear</span></th></tr>';
for(x=1;x<=WANTINGSPOTS;x++) {
	html += '<tr><th valign=\'center\'>Want '+x+'</th><td><select size="3" onChange="shopthis('+x+',this.value);">';
	html += '<option value=""></option>';

		for(i=0;i<all_items.length;i++) {
			html += '<option value="'+all_items[i][1]+'"';
			if(all_items[i][1]==localStorage.getItem('spot'+x)) { html += ' selected'; }
			html += '>'+all_items[i][1]+'</option>';
		}
	html += '</select></td></tr>';
}
html += '</table>';

document.getElementById('content').innerHTML += html;

var wanting = [0,['',''],['',''],['',''],['',''],['',''],['',''],['','']];
for(i=1;i<=WANTINGSPOTS;i++) {
	var item = localStorage.getItem('spot'+i);
	if(item!==null) {
		armorArray = bodyArray.concat(helmetArray).concat(glovesArray).concat(bootsArray);
        for(a=0;a<armorArray.length;a++) {
            if(armorArray[a][1]==item) {
			wanting[i] = ['armors',item];
            }
		}
        for(a=0;a<weaponArray.length;a++) {
            if(weaponArray[a][1]==item) {
			wanting[i] = ['weapons',item];
            }
		}
        for(a=0;a<shieldArray.length;a++) {
            if(shieldArray[a][1]==item) {
			wanting[i] = ['shields',item];
            }
		}
	}
}
function objToString (obj) {
    var str = '';
    for (var p in obj) {
        if (obj.hasOwnProperty(p)) {
            str += p + '::' + obj[p] + '\n';
        }
    }
    return str;
}
Object.size = function(obj) {
    var size = 0, key;
    for (key in obj) {
        if (obj.hasOwnProperty(key)) size++;
    }
    return size;
};
var temp = document.body.innerHTML;
var HAH = eval("(" + temp.split("BOTS4.initAll('")[1].split("'.evalJSON()")[0] + ")");
for(i=1;i<=WANTINGSPOTS;i++) {
	if(wanting[i][0]!='') {
		// check in stash
		var found = 0;
		if(wanting[i][0]=='armors') {
			if(get('shopperStash')=='yes') {
			for(s=0;s<HAH.stash.length;s++) {
				if(HAH.stash.name==wanting[i][1]) {
					found = 1;
				}
			}
			}
			if(get('shopperEquip')=='yes') {
			if(HAH.body.name==wanting[i][1]) { found = 1; }
			if(HAH.helmet.name==wanting[i][1]) { found = 1; }
			if(HAH.gloves.name==wanting[i][1]) { found = 1; }
			if(HAH.boots.name==wanting[i][1]) { found = 1; }
			if(HAH.primary.name==wanting[i][1]||HAH.secondary.name==wanting[i][1]) { found = 1; }
			}
		}
		if(found==0) {
		var where = wanting[i][0];
		var Wantname = wanting[i][1];
		for(x=0;x<HAH[where].length;x++) {
			var item = HAH[where][x];
			if (item.name.toLowerCase()==Wantname.toLowerCase()) {
				// STASH (BOTS4.stash.stashFree === 0) { no room }
				// BUY BOTS4.util.post('/showroom', {'action': 'buy', 'buyId': this.item.id});
				// STR : reqstr
				// DEX : reqdex
				// Kudos : price
				// YOUR str : HAH.str
				// YOUR dex : HAH.dex
				// YOUR kudos : HAH.kudos
				// ITEM ID : HAH[where][x].id
				// Find how many stashes you have free
               var free = 0;
                for(s=0;s<HAH.stash.length;s++) {
                    if(HAH.stash[s]==null) { free++; }   
                }
				if(item.reqstr<=HAH.str&&item.reqdex<=HAH.dex&&item.price<=HAH.kudos&&free>0) {
					if((HAH.str*.7<=item.reqstr&&HAH.dex*.7<=item.reqdex)||item.rarity=='unique') {
							BOTS4.util.post('http://bots4.net/showroom', {'action': 'buy', 'buyId': item.id});
					}
				}
			}
		}
		}
	}
}
